  [],\n\t\"revision_timestamp\": \"2015-09-27T00:39:03.774297\",\n\t\"name\": \"ncep-gts-marine-observations-in-bufr-format\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Global Telecommunications System (GTS)
  is a major component of transmitting global meteorological data, consisting of both
  in situ and satellite observations. This data is collected by a number of organizations,
  which archive and further process the data. The National Centers for Environmental
  Prediction (NCEP) collect this GTS data and formats it into BUFR (Binary Universal
  Form for the Representation of meteorological data) for their processing needs.
  After processing, the BUFR is transmitted to NCAR for archival and additional processing
  into the International Maritime Meteorological Archive (IMMA) format for the International
  Comprehensive Ocean-Atmosphere Data Set (ICOADS). NCAR also archives this IMMA-formatted
  data. NCDC will use these data as source input for the new ICOADS Near-Real-Time
  (NRT) product and will archive the two data streams from NCAR--the NCEP-BUFR data
  as well as IMMA (International Maritime Meteorological Archive) formatted data files
  (converted from the NCEP-BUFR file format) that are produced by NCAR. The IMMA format
  has been adopted by many organizations as the preferred format for marine observations.
  The data consists of basic observations taken from ships, buoys, C-MAN (Coastal
  Marine Automated Network), and tide-gauge stations. Observations may include: air
  and sea surface temperature, wind direction/speed, waves, sea level pressure, etc.\",\n\t\"license_title\":
